(7485, 1, 'admin/faqs/3', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"1\",\"question\":\"Do I need to pay extra charges for online payment or online orders?\",\"answer\":\"All extra charges are taken by Partner owner. MeatXpresso Delivery is not taking any extra charges for online payment or online orders.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/17\\/edit\"}', '2023-03-11 10:10:37', '2023-03-11 10:10:37'),
