(7489, 1, 'admin/faqs/20', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"3\",\"question\":\"How do i know status of my order?\",\"answer\":\"After you place your order, it is sent immediately to the Partner shop, which starts preparing it without any delay. Delivery your order as quickly as possible. However, sometimes Partner receives large amount of orders, or drivers get stuck in heavy traffic this might cause little delays. If the amount of time you\'ve waited has exceeded the estimated delivery time, you may please contact us. You will a receive an SMS as soon as your order is dispatched.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/3\\/edit\"}', '2023-03-11 10:12:54', '2023-03-11 10:12:54'),
