(7505, 1, 'admin/faqs/26', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"5\",\"question\":\"What kind of Partner shops can I expect?\",\"answer\":\"We partner with top local shop your team loves, from local landmarks to hidden hotspots.\\r\\n\\r\\nOur wide selection of shops  allows you to choose from many cuisine types. Best of all we\\u2019re always adding new ones, lookout for your new favorite Partner Shop coming soon!\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/20\\/edit\"}', '2023-03-11 10:20:54', '2023-03-11 10:20:54'),
