(7510, 1, 'admin/faqs/31', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"4\",\"question\":\"Does MeatXpresso Delivery refund money after cancellation?\",\"answer\":\"Any user on MeatXpresso Delivery is eligible for a refund if you have placed a prepaid order but the restaurant cancels your order because of the unavailability of items on the menu. In that case, you will get a full refund of your order. The refund will get credited in the same manner as your mode of payment.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/26\\/edit\"}', '2023-03-11 10:23:07', '2023-03-11 10:23:07'),
