(7513, 1, 'admin/faqs/32', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"4\",\"question\":\"How does MeatXpresso  Delivery refund money?\",\"answer\":\"MeatXpresso Delivery processes a refund to the mode of payment chosen by you. If you paid via cash, you will get the refund in your app wallet or bank account. You can get a refund if the Partner Shop agrees. ... Once the Partner Shop agrees, MeatXpresso Delivery will give your money back.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/31\\/edit\"}', '2023-03-11 10:24:18', '2023-03-11 10:24:18'),
