(7518, 1, 'admin/faqs/22', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"9\",\"question\":\"How to I signup as Partner?\",\"answer\":\"Open  Delivery MeatXpresso app  go directly to Vendor sign up page and choose a plan to complete the sign up. For step-by-step instructions and next steps before or after sign up, see How to sign up as Partner.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/32\\/edit\"}', '2023-03-11 10:25:49', '2023-03-11 10:25:49'),
