(7525, 1, 'admin/faqs/23', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"10\",\"question\":\"Is there a pickup and delivery fee?\",\"answer\":\"A Vendor may set a minimum order amount for free pickup and delivery. In that case, a Customer will be given the option to add additional items to meet the minimum amount or elect to pay the pickup and delivery fee.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/22\\/edit\"}', '2023-03-11 10:26:47', '2023-03-11 10:26:47'),
