(7530, 1, 'admin/faqs/24', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"8\",\"question\":\"How do I add a product to my Delivery Partner Shop?\",\"answer\":\"Sign in and navigate to your account dashboard. Click on Products tab.\\r\\nOn Products page, click on Add product and enter the requested information.\\r\\nClick Submit.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/23\\/edit\"}', '2023-03-11 10:27:43', '2023-03-11 10:27:43'),
