(7535, 1, 'admin/faqs/25', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"3\",\"question\":\"Can I order from multiple Partner Shops?\",\"answer\":\"Of course! We understand for larger scale events having multiple Partner shops options is important. If you need cuisine variety for your meeting or event feel free to reach out to your Account Manager to assist in planning your event.\\r\\n\\r\\nWe do not recommend ordering from multiple shops for small group orders because each shop is treated as an individual order with a delivery fee for each order.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/24\\/edit\"}', '2023-03-11 10:29:38', '2023-03-11 10:29:38'),
