(7540, 1, 'admin/faqs/27', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"2\",\"question\":\"Why are you not delivering to my city?\",\"answer\":\"We are rapidly expanding throughout  Lebanon and will hopefully be working with Partner Shops near you soon!\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/25\\/edit\"}', '2023-03-11 10:31:04', '2023-03-11 10:31:04'),
