(7545, 1, 'admin/faqs/34', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"1\",\"question\":\"How do I complete a payment on MeatXpresso Delivery?\",\"answer\":\"The updated version of the Android and iOS app now allow people to pay via credit cards, debit card and other net banking options. The option to make online payments is currently available only in select Partner Shops. The company, it seems, has partnered with PayPal for enabling online payments.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/27\\/edit\"}', '2023-03-11 10:32:10', '2023-03-11 10:32:10'),
