(7568, 1, 'admin/faqs/37', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"1\",\"question\":\"Is GST applicable on home delivery of Meat?\",\"answer\":\"Under the new system ,meat-delivery ECOs will be responsible for paying GST. At present, it is the shop that is paying. The government has already clarified that this is no new tax and there will be no implication for customers. The rate of tax will continue to be 5 per cent\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/36\\/edit\"}', '2023-03-11 11:31:10', '2023-03-11 11:31:10'),
