(7573, 1, 'admin/faqs/38', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"4\",\"question\":\"Why is MeatXpresso Delivery not giving refunds?\",\"answer\":\"You are not delivering customer\'s order of meat when you claim you will. ... After a lot of hardships I was able to contact MeatXpresso Delivery through their chat support platform & they ensured me the refund of my money which I already paid them while placing online meatorder.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/37\\/edit\"}', '2023-03-11 11:32:24', '2023-03-11 11:32:24'),
