(7576, 1, 'admin/faqs/39', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"4\",\"question\":\"What is the validity of MeatXpresso Delivery credits?\",\"answer\":\"75 cashback as meatxpresso Delivery Credits will expire after 7 days from the date of order placement.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/38\\/edit\"}', '2023-03-11 11:33:09', '2023-03-11 11:33:09'),
