(7579, 1, 'admin/faqs/40', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"2\",\"question\":\"What is tamper proof meat packaging?\",\"answer\":\"Tamper-resistance is more self-explanatory, it is packaging that is designed to resist access to the product contained within the package. There are many ways to provide product security through TRP.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/39\\/edit\"}', '2023-03-11 11:33:46', '2023-03-11 11:33:46'),
