(7585, 1, 'admin/faqs/41', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"2\",\"question\":\"Why proper meat packaging is important?\",\"answer\":\"Meat  packaging is vital for protecting meat  against external microbes and bacteria. It can also help preserve meat  and ensure it doesn\'t spoil.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/40\\/edit\"}', '2023-03-11 11:35:05', '2023-03-11 11:35:05'),
