(7590, 1, 'admin/faqs/43', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"2\",\"question\":\"Who is responsible for ensuring packaging material is safe?\",\"answer\":\"The entire meat packaging supply chain works to ensure that their products are safe and suitable for use in contact with meat. Manufacturers, from chemical companies to finished packaging material suppliers and food companies are obligated to ensure the legal compliance of the packaging materials that they sell and use. These companies work with FDA to ensure that all materials have the necessary premarket approvals, and that they are produced and maintained under safe and sanitary conditions.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/41\\/edit\"}', '2023-03-11 11:36:53', '2023-03-11 11:36:53'),
