(7597, 1, 'admin/faqs/45', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"7\",\"question\":\"What is FSSAI registration number?\",\"answer\":\"FSSAI license number is a 14-digit number issued to registered Food Business Operators (FBOs); it comprises of five sections, each of them providing different information about the meat business operator. The aforementioned indicator has to be affixed on the package of the meat product, added with the FSSAI logo.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/44\\/edit\"}', '2023-03-11 11:39:29', '2023-03-11 11:39:29'),
