(7601, 1, 'admin/faqs/46', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"9\",\"question\":\"How does MeatXpresso Delivery work for Partner Shops?\",\"answer\":\"The main work of MeatXpressoDelivery is to suggest local and nearby partner shops to users and receive orders from them. Users can place orders from their favorite shops based on ratings and reviews shared by previous customers.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/45\\/edit\"}', '2023-03-11 11:59:58', '2023-03-11 11:59:58'),
