(7606, 1, 'admin/faqs/47', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"9\",\"question\":\"How does Partner shops earn from MeatXpresso Delivery?\",\"answer\":\"MeatXpresso Delivery charges commissions from  partners shop for listing on its app and delivering meat... Customers also pay for packaging charges on select orders, which again are passed through to  partner shops. Tips paid by customers (if any) are also passed to delivery boys. MeatXpresso Delivery also earns advertisement revenue.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/46\\/edit\"}', '2023-03-11 12:02:43', '2023-03-11 12:02:43'),
