(7611, 1, 'admin/faqs/58', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"10\",\"question\":\"How do Partner shops pay for MeatXpresso Delivery?\",\"answer\":\"MeatXpresso Delivery currently charges a commission fee of 7% of the total orders from the Partner shops under its meat ordering business. This does not include delivery and payment gateway charges.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/47\\/edit\"}', '2023-03-11 12:04:11', '2023-03-11 12:04:11'),
