(7614, 1, 'admin/faqs/53', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"8\",\"question\":\"How often should a Partner Shop change its menu?\",\"answer\":\"It\'s recommended you update your shops\'s menu at least once a year. If you\'re a more seasonal establishment, then you might swap out new variety offerings for the season as many as four times a year. Upgrading the menu annually or more than once a year is a good way to control meat costs.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/58\\/edit\"}', '2023-03-11 12:05:19', '2023-03-11 12:05:19'),
