(7617, 1, 'admin/faqs/54', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"8\",\"question\":\"Why do partner shops add new menu items?\",\"answer\":\"Among the reasons partner shops like to change their menus is not only to offer guests new dishes ~ it also helps chefs to push the culinary envelope and flex their culinary muscles. ... \\u201cEspecially in culinary, cooks work with certain chefs so they can learn, absorb and grow.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/53\\/edit\"}', '2023-03-11 12:06:21', '2023-03-11 12:06:21'),
