(7622, 1, 'admin/faqs/65', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"11\",\"question\":\"What are the benefits of joining as a Delivery Partner?\",\"answer\":\"As a  Delivery boy  you will be provided with personal accidental life and health insurance. This provides insurance coverage against injuries and protects you against financial cost in the unfortunate event of an accident.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/54\\/edit\"}', '2023-03-11 12:07:18', '2023-03-11 12:07:18'),
