(7627, 1, 'admin/faqs/73', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"12\",\"question\":\"How does delivery app work?\",\"answer\":\"Ordering occurs at the app where the menu of a partner shop is uploaded. Customers select the meat  items and make payments (some providers also offer cash on delivery). Once the amount goes through, the partner shop is notified about the request, and they can confirm or reject the order.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/65\\/edit\"}', '2023-03-11 12:08:37', '2023-03-11 12:08:37'),
