(7646, 1, 'admin/faqs/71', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"3\",\"question\":\"What are some general guidelines for delivering meat safely?\",\"answer\":\"Received meat should have the correct color, texture, and order. The packaging of delivered meat items must be intact and clean and it must protect food from contamination. There should also be no sings of pests or dampness. Meat items should be correctly labeled and contain the correct documentation.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/57\\/edit\"}', '2023-03-11 12:28:29', '2023-03-11 12:28:29'),
