(7651, 1, 'admin/faqs/70', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"3\",\"question\":\"Why is online delivery important?\",\"answer\":\"Online meat ordering gives customers the freedom and choice to place an order at virtually any time, from anywhere, saving the time and resources typically spent on travelling to pick up a meat. It also gives the customers the advantage of reordering the favorite order in the easiest and hassle-free manner.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/71\\/edit\"}', '2023-03-11 12:29:20', '2023-03-11 12:29:20'),
