(7656, 1, 'admin/faqs/69', 'PUT', '49.205.82.162', '{\"faq_category_id\":\"12\",\"question\":\"How do you manage meatxpresso delivery service?\",\"answer\":\"Provide Great Service. Outsource Delivery Drivers. Proper Address and Client Communication. Focus On Packaging.\",\"_token\":\"y7EeGx2i5eiAgKL1tTZ7ffYYnAH498FkOWQF3bg1\",\"_method\":\"PUT\",\"_previous_\":\"https:\\/\\/meatxpresso.menpaniproducts.com\\/admin\\/faqs\\/70\\/edit\"}', '2023-03-11 12:30:05', '2023-03-11 12:30:05'),
