INSERT INTO `customer_app_settings` (`id`, `app_name`, `app_logo`, `default_currency`, `currency_short_code`, `restaurant_radius`, `opening_time`, `closing_time`, `delivery_charge_per_km`, `description`, `app_version`, `address`, `max_cash_validation`, `razorpay_key`, `created_at`, `updated_at`) VALUES
(1, 'Meat Xpresso', 'images/377816ee2aac116301748de1f628b807.png', '₹', 'INR', 500, '09:00:00', '09:00:00', 10, 'Meat Xpresso customer App is the one-stop-solution for restaurants to manage their online orders from Food Gallery Delivery and track their business growth as well. Download the app now and join our ever growing network of Happy Partners fulfilling online orders and becoming part of our mission to serve \"Better food for more people\". A restaurant app is a mobile application dedicated to a specific restaurant concept or chain of restaurants. Most restaurant apps are centered around digital ordering, but they typically also include information on guest loyalty rewards, specials, and promotions.', 'App version 1.0', 'Menpani Technology, Madurai, Tamilnadu', 10, 'rzp_test_l4vdC6vGJ6mk8Q', '2022-11-28 07:27:16', '2023-03-08 13:51:47');
