INSERT INTO `delivery_boy_app_settings` (`id`, `app_name`, `app_logo`, `default_currency`, `currency_short_code`, `delivery_charge_per_km`, `description`, `app_version`, `address`, `booking_searching_radius`, `created_at`, `updated_at`) VALUES
(1, 'Meat Xpresso Delivery boy', 'images/b0e10afd5530bf6716ecaede9046083b.png', '₹', 'INR', 6, 'Become a Meat Xpressso Delivery boy with Food Galery, & earn weekly payments and exciting incentives. ... Download the mobile app and start earning weekly. Food Galery Partner App aims to simplify the process of conveying orders to partners and streamlining the entire process of ordering in, from confirming to preparation to delivery. The app serves as a bridge between our partners and Food Galery for ordering.', 'App version 1.0', 'Menpani Technology, Madurai, Tamilnadu', 15, '2021-12-13 14:32:54', '2023-03-09 08:30:58');
INSERT INTO `faqs` (`id`, `question`, `answer`, `image`, `created_at`, `updated_at`, `faq_category_id`) VALUES
(1, 'How can customer can view history of placed order from MeatXpresso Delivery?', 'You just have to login to your user account and click on My Orders to view full order details and history.', 'faqs/011f474ab5293e431a456cbfbe543cea.webp', '2022-01-18 04:30:02', '2023-03-10 13:20:31', 3),
(2, 'How can customer change ingredients or customize item ?', 'If Partner owner have provided functionality to customize the item. User have to open menu of the vendor and click on Customize for item which you want to customize. You can change the ingredients or add more ingredients to item according to your choice.', 'faqs/e4e048d879f3c5ab6e372c5c71c216b0.jpg', '2022-01-18 04:37:49', '2023-03-11 09:54:52', 3),
(3, 'Do I need to pay extra charges for online payment or online orders?', 'All extra charges are taken by Partner owner. MeatXpresso Delivery is not taking any extra charges for online payment or online orders.', 'faqs/6e7197ae9d6b98395915b7c8d2771d90.webp', '2022-01-18 04:43:12', '2023-03-11 10:10:37', 1),
(4, 'Who will issue refund for order cancellation or other issue?', 'To customer, refund will be issue by restaurant owner only. MeatXpresso Delivery is not responsible for order cancellation or refund of the order.', 'faqs/6dcfcc20df0541adece5580e5cb4a289.webp', '2022-01-18 04:46:46', '2023-03-10 13:21:16', 4),
(5, 'Who will receive payment of orders?', 'Partner owner will get whole payment of orders placed through MeatXpresso Delivery.', 'faqs/a993e3038ba180bdbbd306ba3a6b842f.webp', '2022-01-18 04:49:11', '2023-03-11 09:55:30', 1),
(6, 'How to join newsletter for new offers and new?', 'You can join newsletter for upcoming offers and news. You can join newsletter of any partner shop from home page of respective shop. You have to enter your email id to join newsletter.', 'faqs/8fbb2b5c51c053c096354823925f73a0.webp', '2022-01-18 04:50:37', '2023-03-11 09:56:24', 5),
(7, 'How can customer send special request or instruction about food while placing orders?', 'MeatXpresso Delivery is providing you facility to send your special request or notes to partner shop with your order. You can write your special notes at the time of providing information of your address and all.', 'faqs/7ce235b4c41ada0f3e716d88fadd2798.jpeg', '2022-01-18 04:53:04', '2023-03-11 09:57:21', 3),
(8, 'How to change password of customer account?', 'Customer can change password of their panel by going to My Profile after login to their account. After changing the password of customer account customer can login to account using new password.', 'faqs/327978d59af6e823ecf20f811e9d6018.webp', '2022-01-18 04:55:55', '2022-01-18 16:04:58', 5),
(9, 'How to sign up as a new customer?', 'Customer should register themselves on MeatXpresso Delivery if they are regular user of  Delivery. They can register themselves on  Delivery by few simple clicks. They to go to Login option on any Partner Shop and click on I am a New User.', 'faqs/4b4b1c6383f169189b84aab76ecd53c0.webp', '2022-01-18 04:58:32', '2023-03-11 09:59:00', 5),
(10, 'How to view social media pages of Partner Shop?', 'Partner owner can list out their partner pages of various social media too, so that customer can visit those pages. Customer can view link of social media page of Shop from partner page. Customer have to go to partner page and scroll down for social media page link of URL.', 'faqs/575bece11d6f1e9118f1873f5e4ce098.webp', '2022-01-18 05:02:02', '2023-03-11 10:00:42', 5),
(11, 'How to login to Admin Panel?', 'On  Delivery every Partner owner has their own admin panel from where owner can manage their shop details. For login to admin panel of Partner, Partner owner have to go to their Partner page. Owner have to click on Partner Login to login in admin panel of Partner Shop.', 'faqs/c9ea7dedd40972339100f01dc5885472.webp', '2022-01-18 05:10:39', '2023-03-11 10:02:05', 9),
(12, 'How to give rating to particular Partner Shop?', 'To improve performance of anything feedback of customer is very important.  Delivery also providing facility to give your feedback to partner shop. Just few simple clicks and your feedback will be recorded. Go to About page of any Partner shop and Click on Add Reviews. Give your feedback and it will be display on particular Partner page.', 'faqs/54c13caca70e9df2b8ed336e0e23e2df.webp', '2022-01-18 05:12:39', '2023-03-11 10:03:24', 5),
(13, 'How to view reviews for particular Partner Shop?', 'On Delivery customer can also provide rating to Partner shop so that other customer will able to view those review. Go to any Partner  page and scroll down to view reviews/rating of that particular Partner Shop.', 'faqs/09f2210d3b6b3241be1f84f68800cf02.webp', '2022-01-18 05:14:37', '2023-03-11 10:04:42', 5),
(14, 'How to view only Egg item from Partner menu?', 'Searching your favourite item from whole menu is headache. Delivery providing solution for this also. Go to Egg page of your selected shop and click on Egg items.', 'faqs/c3d4acf16ed89814238b3a1cbf6d90f0.webp', '2022-01-18 05:17:23', '2023-03-11 10:07:36', 5),
(15, 'How to view non-veg item from Partner menu?', 'Searching your favourite item from whole menu is headache. Delivery providing solution for this also. If you are interested in only Non-Veg items then view menu of only Non-Veg items. Go to Cuisine page of your selected shop and click on Non-Veg.', 'faqs/88568e01684bb4c700d9fc0db97a8218.webp', '2022-01-18 05:18:32', '2023-03-11 10:08:29', 5),
(16, 'How to search city wise Partner Shop?', 'To search Partner Shops in particular city is very simple with MeatXpresso Delivery. Enter preferred city name in search bar and click on search. All shops listed in searched city will be display.', 'faqs/8af9d0e8a0d1847dd6c1c5190cb97fb2.webp', '2022-01-18 05:20:23', '2023-03-11 10:09:55', 5),
(17, 'Where can I see my orders?', 'All orders can be viewed directly in your administrative panel.', 'faqs/77be6a855678781fbd65eb5a5dd567de.webp', '2022-01-18 05:37:40', '2022-01-18 05:37:40', 9),
(18, 'Do you support bulk orders?', 'In order to provide all customers with a great selection and to ensure on-time delivery of your meal, we request you to order bulk quantity at least 24 hours in advance.', 'faqs/15bd6383b314c3206b5f4f5ae0bcca84.webp', '2022-01-18 05:43:59', '2023-03-11 10:35:21', 3),
(19, 'I want an invoice for my order?', 'Invoice Copy is sent via email & Text Message.', 'faqs/21e4cfd0aab58114ec1e9579f5f31ab6.jpeg', '2022-01-18 05:46:28', '2022-01-18 16:12:08', 3),
(20, 'How do i know status of my order?', 'After you place your order, it is sent immediately to the Partner shop, which starts preparing it without any delay. Delivery your order as quickly as possible. However, sometimes Partner receives large amount of orders, or drivers get stuck in heavy traffic this might cause little delays. If the amount of time you\'ve waited has exceeded the estimated delivery time, you may please contact us. You will a receive an SMS as soon as your order is dispatched.', 'faqs/a4fc73ac4fd24812e5f588571b243bdc.jpeg', '2022-01-18 05:51:24', '2023-03-11 10:12:54', 3),
(21, 'Is there any limit for orders menu?', 'Although, there is no pre-set limit in the order menu but we can make it functional as per your custom request.', 'faqs/ad8950e3eff054e365bf79cdad3bf83e.webp', '2022-01-18 05:54:34', '2022-01-19 06:56:17', 8),
(22, 'How to I signup as Partner?', 'Open  Delivery MeatXpresso app  go directly to Vendor sign up page and choose a plan to complete the sign up. For step-by-step instructions and next steps before or after sign up, see How to sign up as Partner.', 'faqs/6c9f7e1045905540b569b401ca509021.webp', '2022-01-18 06:15:53', '2023-03-11 10:25:49', 9),
(23, 'Is there a pickup and delivery fee?', 'A Vendor may set a minimum order amount for free pickup and delivery. In that case, a Customer will be given the option to add additional items to meet the minimum amount or elect to pay the pickup and delivery fee.', 'faqs/1e72b2f456b9c5a6366835d498f6aeba.webp', '2022-01-18 06:21:26', '2022-01-18 06:21:26', 10),
(24, 'How do I add a product to my Delivery Partner Shop?', 'Sign in and navigate to your account dashboard. Click on Products tab.\r\nOn Products page, click on Add product and enter the requested information.\r\nClick Submit.', 'faqs/3c0e952337dc1d589e397251f4af8bd7.webp', '2022-01-18 06:26:05', '2023-03-11 10:27:43', 8),
(25, 'Can I order from multiple Partner Shops?', 'Of course! We understand for larger scale events having multiple Partner shops options is important. If you need cuisine variety for your meeting or event feel free to reach out to your Account Manager to assist in planning your event.\r\n\r\nWe do not recommend ordering from multiple shops for small group orders because each shop is treated as an individual order with a delivery fee for each order.', 'faqs/95d7a4380d6f06506b6cf84414353bac.webp', '2022-01-18 06:51:47', '2023-03-11 10:29:38', 3),
(26, 'What kind of Partner shops can I expect?', 'We partner with top local shop your team loves, from local landmarks to hidden hotspots.\r\n\r\nOur wide selection of shops  allows you to choose from many cuisine types. Best of all we’re always adding new ones, lookout for your new favorite Partner Shop coming soon!', 'faqs/a8d22da8995c474f4ed44cd3872c8580.webp', '2022-01-18 06:58:14', '2023-03-11 10:20:54', 5),
(27, 'Why are you not delivering to my city?', 'We are rapidly expanding throughout  Lebanon and will hopefully be working with Partner Shops near you soon!', 'faqs/15b1c80d0e0bc639e091a3d537eea016.jpg', '2022-01-18 07:00:08', '2023-03-11 10:31:04', 2),
(28, 'What are the login hours?', 'The login hours are flexible. You can choose to login anytime depending on your availability.', 'faqs/354cef804d1461e74047de7dbd9f5424.jpeg', '2022-01-18 07:06:17', '2022-01-19 07:01:51', 7),
(29, 'When do I start delivering orders?', 'Once your registration is complete, our team will run a background check after which you can start delivering orders.', 'faqs/f469d9b02e8a2bc0f37e657496f98cf7.webp', '2022-01-18 07:11:59', '2022-01-19 07:02:41', 6),
(30, 'How will I get paid?', 'We will transfer your earnings on a weekly basis directly in your bank account. You can check your earnings in your app under the Payments section.', 'faqs/17337f937dfe7977cdcfa9ecc1ff5b09.webp', '2022-01-18 07:14:13', '2022-01-18 08:34:19', 10),
(31, 'Does MeatXpresso Delivery refund money after cancellation?', 'Any user on MeatXpresso Delivery is eligible for a refund if you have placed a prepaid order but the restaurant cancels your order because of the unavailability of items on the menu. In that case, you will get a full refund of your order. The refund will get credited in the same manner as your mode of payment.', 'faqs/df8a1b0d1571b16d5ffd03771bd39c77.webp', '2022-01-18 07:19:05', '2023-03-11 10:23:07', 4),
(32, 'How does MeatXpresso  Delivery refund money?', 'MeatXpresso Delivery processes a refund to the mode of payment chosen by you. If you paid via cash, you will get the refund in your app wallet or bank account. You can get a refund if the Partner Shop agrees. ... Once the Partner Shop agrees, MeatXpresso Delivery will give your money back.', 'faqs/5225cb5c6d9e8aa94d726f70a1ca9859.webp', '2022-01-18 07:25:23', '2023-03-11 10:24:18', 4),
(33, 'How do I complete a payment on ToukTouk Delivery?', 'The updated version of the Android and iOS app now allow people to pay via credit cards, debit card and other net banking options. The option to make online payments is currently available only in select restaurants. The company, it seems, has partnered with PayPal for enabling online payments.', 'faqs/44540a41726dc98c355bc66fc61744f4.webp', '2022-01-18 07:27:33', '2022-01-18 07:27:33', 10),
(34, 'How do I complete a payment on MeatXpresso Delivery?', 'The updated version of the Android and iOS app now allow people to pay via credit cards, debit card and other net banking options. The option to make online payments is currently available only in select Partner Shops. The company, it seems, has partnered with PayPal for enabling online payments.', 'faqs/4b30aa9b63bf7cfcf4f7152acb78c5b6.webp', '2022-01-18 07:28:10', '2023-03-11 10:32:10', 1),
(35, 'Do you tip MeatXpresso Delivery?', 'Currently, when our users tip their delivery boys, it only reflects on their payout at the end of every week. ... Moreover, we are also looking to enhance the user experience by giving our delivery boys an option of thanking our users for tipping them.', 'faqs/2f5c52713a402166da0ca15e2d3b96a7.webp', '2022-01-18 07:34:31', '2023-03-11 10:33:39', 1),
(36, 'Do you tip MeatXpresso Delivery?', 'Currently, when our users tip their delivery partners, it only reflects on their payout at the end of every week. ... Moreover, we are also looking to enhance the user experience by giving our delivery partners an option of thanking our users for tipping them.', 'faqs/0080d7c65c4dd583a8d3707e7a624f77.webp', '2022-01-18 07:37:17', '2023-03-11 11:29:07', 10),
(37, 'Is GST applicable on home delivery of Meat?', 'Under the new system ,meat-delivery ECOs will be responsible for paying GST. At present, it is the shop that is paying. The government has already clarified that this is no new tax and there will be no implication for customers. The rate of tax will continue to be 5 per cent', 'faqs/4963ed2d932dc3c5b48092fafc025a03.webp', '2022-01-18 07:53:37', '2023-03-11 11:31:10', 1),
(38, 'Why is MeatXpresso Delivery not giving refunds?', 'You are not delivering customer\'s order of meat when you claim you will. ... After a lot of hardships I was able to contact MeatXpresso Delivery through their chat support platform & they ensured me the refund of my money which I already paid them while placing online meatorder.', 'faqs/73c8efab6f75a2a65b9cb8b3ee3d6db1.webp', '2022-01-18 07:56:29', '2023-03-11 11:32:24', 4),
(39, 'What is the validity of MeatXpresso Delivery credits?', '75 cashback as meatxpresso Delivery Credits will expire after 7 days from the date of order placement.', 'faqs/54bbbd7a3eb03a062132539f04de3613.webp', '2022-01-18 08:00:24', '2023-03-11 11:33:09', 4),
(40, 'What is tamper proof meat packaging?', 'Tamper-resistance is more self-explanatory, it is packaging that is designed to resist access to the product contained within the package. There are many ways to provide product security through TRP.', 'faqs/219d1b7f289b24e3da14c65c01b56769.jpg', '2022-01-18 08:04:01', '2023-03-11 11:33:46', 2),
(41, 'Why proper meat packaging is important?', 'Meat  packaging is vital for protecting meat  against external microbes and bacteria. It can also help preserve meat  and ensure it doesn\'t spoil.', 'faqs/70df15c983100c71196372fe806f6c50.jpeg', '2022-01-18 08:09:07', '2023-03-11 11:35:05', 2),
(42, 'What are the main purpose of packaging?', 'The primary purpose of packaging is to protect its contents from any damage that could happen during transport, handling and storage. Packaging retains the product intact throughout its logistics chain from manufacturer to the end user. It protects the product from humidity, light, heat and other external factors', 'faqs/42d0213b3d1530b1e79e7d93df0dd330.jpeg', '2022-01-18 08:11:10', '2022-01-18 16:18:59', 2),
(43, 'Who is responsible for ensuring packaging material is safe?', 'The entire meat packaging supply chain works to ensure that their products are safe and suitable for use in contact with meat. Manufacturers, from chemical companies to finished packaging material suppliers and food companies are obligated to ensure the legal compliance of the packaging materials that they sell and use. These companies work with FDA to ensure that all materials have the necessary premarket approvals, and that they are produced and maintained under safe and sanitary conditions.', 'faqs/3c0ea0d1812c6218c97285d25776e5b8.jpeg', '2022-01-18 08:13:16', '2023-03-11 11:36:53', 2),
(44, 'Is my meat being affected by its packaging?', 'The materials surrounding your meat serve several purposes, such as, protection and preservation, but must do so without compromising the quality . As such, materials are selected with health and quality impacts in mind, and this process must take place for each individual meat.', 'faqs/71ffbbd48b2d9e53025960bf89d0d04e.webp', '2022-01-18 08:15:20', '2023-03-11 11:38:36', 2),
(45, 'What is FSSAI registration number?', 'FSSAI license number is a 14-digit number issued to registered Food Business Operators (FBOs); it comprises of five sections, each of them providing different information about the meat business operator. The aforementioned indicator has to be affixed on the package of the meat product, added with the FSSAI logo.', 'faqs/55bb95fb1c58b112f2f666f27b91fbfc.webp', '2022-01-18 08:32:49', '2023-03-11 11:39:29', 7),
(46, 'How does MeatXpresso Delivery work for Partner Shops?', 'The main work of MeatXpressoDelivery is to suggest local and nearby partner shops to users and receive orders from them. Users can place orders from their favorite shops based on ratings and reviews shared by previous customers.', 'faqs/e5b68540c224d760fd777ad8eee889b0.jpg', '2022-01-18 08:44:50', '2023-03-11 11:59:58', 9),
(47, 'How does Partner shops earn from MeatXpresso Delivery?', 'MeatXpresso Delivery charges commissions from  partners shop for listing on its app and delivering meat... Customers also pay for packaging charges on select orders, which again are passed through to  partner shops. Tips paid by customers (if any) are also passed to delivery boys. MeatXpresso Delivery also earns advertisement revenue.', 'faqs/ec829616c4f5f9c3be740fda89d17733.jpg', '2022-01-18 08:48:08', '2023-03-11 12:02:43', 9),
(48, 'Can I sell homemade food on ToukTouk Delivery?', 'One person can sell Home food online on ToukTouk Delivery but he requires some essential things that are mentioned below. To work as a business, you must have to register for a company. You can register for any company (LLP, Partnership firm, or One Person Company) and start selling home food online.', 'faqs/4397414e3194a273ee5e4ffad08b0981.jpeg', '2022-01-18 08:50:16', '2022-01-19 07:04:55', 7),
(49, 'How can I edit my delivery address for an ongoing order?', 'Any major change in delivery address is not possible once you\'ve already placed an order. However, if your new address is nearby, you can check with the delivery executive for assistance.', 'faqs/99db7cfe038aceb49a92fa49d6866753.jpeg', '2022-01-18 08:53:58', '2022-01-18 16:20:25', 2),
(50, 'How do I change my restaurant picture on ToukTouk Delivery?', 'You can now choose an image from your phone\'s gallery or tap the use camera button and click a new picture as per the ToukTouk Delivery guidelines.', 'faqs/03d7a926723c2da748fbd9d6f38fac0f.jpeg', '2022-01-18 09:01:43', '2022-01-19 07:05:14', 7),
(51, 'How do you add a combo on ToukTouk Delivery partner app?', 'To create a Combo, go to Ordering → Combos. Click on Add Combo.', 'faqs/598f0ff321a57862dc9d0b50f18e531c.webp', '2022-01-18 09:03:56', '2022-01-19 07:05:39', 8),
(52, 'What all documents are required for registering on online ordering?', 'FSSAI certificate (application no. if FSSAI is not present), PAN Card, GST certificate (if applicable)', 'faqs/c3ce75545c2838de470265a1657bfa98.jpeg', '2022-01-18 09:08:51', '2022-01-19 07:06:34', 7),
(53, 'How often should a Partner Shop change its menu?', 'It\'s recommended you update your shops\'s menu at least once a year. If you\'re a more seasonal establishment, then you might swap out new variety offerings for the season as many as four times a year. Upgrading the menu annually or more than once a year is a good way to control meat costs.', 'faqs/2b80a147dead5a187a606cbde95e08aa.webp', '2022-01-18 09:16:27', '2023-03-11 12:05:19', 8),
(54, 'Why do partner shops add new menu items?', 'Among the reasons partner shops like to change their menus is not only to offer guests new dishes ~ it also helps chefs to push the culinary envelope and flex their culinary muscles. ... “Especially in culinary, cooks work with certain chefs so they can learn, absorb and grow.', 'faqs/f92d995bc63687d9fd7576ac73b89b80.webp', '2022-01-18 09:18:03', '2023-03-11 12:06:21', 8),
(55, 'I have a large fleet of delivery boys, why should I use ToukTouk Delivery service?', 'You can use your and ToukTouk Delivery fleet simultaneously to increase the network of your delivery radius. Also, our delivery fleet delivers orders in minimum possible time, a key factor leading to increased customer satisfaction.', 'faqs/663a99fd6df8d661d5b23df080fe4752.webp', '2022-01-19 04:50:30', '2022-01-27 07:01:47', 9),
(56, 'What will ToukTouk Delivery charge me for creating a page on its platform?', 'Creating a restaurant page on ToukTOuk Delivery  is free of cost. You can maintain your page by replying to reviews and do a lot more without any charges.', 'faqs/bb5cdedc805ef422c3a0c0304d7f9c4f.webp', '2022-01-19 04:53:40', '2022-01-19 04:53:40', 6),
(57, 'How do I activate my partner shop on MeatXpresso Delivery?', 'Create a MeatXpresso Delivery review listing. Visit MeatXpresso  Delivery add partner page. ...\r\nSubmit request for meatxpresso Delivery boy Registration. ...', 'faqs/6731145bfe1908966cbd2d3d3d659570.jfif', '2022-01-19 05:01:32', '2023-03-11 12:26:31', 6),
(58, 'How do Partner shops pay for MeatXpresso Delivery?', 'MeatXpresso Delivery currently charges a commission fee of 7% of the total orders from the Partner shops under its meat ordering business. This does not include delivery and payment gateway charges.', 'faqs/909dcb7aaae6d3337d2cffbfbdc61774.webp', '2022-01-19 07:10:47', '2023-03-11 12:04:11', 10),
(59, 'Who is a MeatXpresso Delivery Partner?', 'MeatXpresso Delivery Partners are independent contractors, who are required to pick up food items ordered by customers from restaurants / outlets and deliver to customers. Delivery Partners use their own vehicles (Bike/Cycle) to deliver orders to MeatXpresso Delivery customers.', 'faqs/be9cbf289ca6d3311443ee79ba4990f9.jpg', '2022-01-20 19:04:30', '2023-03-10 13:56:35', 11),
(60, 'What are the requirements to become a MeatXpresso Delivery Partner?', 'You must be at least 18 years old. Android phone of version 6.0 or higher with at least 2GB of RAM. A two-wheeler that meets all applicable law and safety requirements. Driving License, Registration Certificate (RC) and Insurance Certificate. Address proof. A valid PAN (Permanent Account Number) Card. Bank Account proof.', 'faqs/2d9787cbed3faf31ebf52228e33000a4.jpg', '2022-01-20 19:08:47', '2023-03-10 13:57:31', 11),
(61, 'What are the login hours?', 'The login hours are flexible. You can choose to login anytime depending on your availability.', 'faqs/6de4242dc7699082a96839d3646f78dc.png', '2022-01-20 19:14:47', '2022-01-20 19:14:47', 14),
(62, 'When do I start delivering orders?', 'Once your registration is complete, our team will run a background check after which you can start delivering orders.', 'faqs/d387e7f98fd5aa5677add3d2203f8657.png', '2022-01-20 19:18:16', '2022-01-20 19:18:16', 12),
(63, 'How much can I earn?', 'You will be working on an earn per delivery model, you will earn for each delivery you make. For more information about this, call on helpline number', 'faqs/9a00a08d892ca1488612c42aca54dbb7.jpg', '2022-01-20 19:21:42', '2022-01-20 19:21:42', 13),
(64, 'How will I get paid?', 'We will transfer your earnings on a weekly basis directly in your bank account. You can check your earnings in your app under the Payments section.', 'faqs/bbfa2df342ef939d644f64c338087dd3.png', '2022-01-20 19:23:09', '2022-01-20 19:23:09', 13),
(65, 'What are the benefits of joining as a Delivery Partner?', 'As a  Delivery boy  you will be provided with personal accidental life and health insurance. This provides insurance coverage against injuries and protects you against financial cost in the unfortunate event of an accident.', 'faqs/414ecf536249f6ecb8a29ec939f02ae4.png', '2022-01-20 19:26:26', '2023-03-11 12:07:18', 11),
(66, 'What is Code of conduct?', 'Mentioned the detailed mandatory code of conduct in the joining agreement.', 'faqs/576e25cd1501677b1a27fc7c22e146e1.png', '2022-01-20 19:30:58', '2022-01-20 19:30:58', 11),
(67, 'How do I register as a certified delivery partner?', 'To register, please fill in your personal details, upload your identity proof, bank details, and your choice of the serviceable locality. Once your documents are verified, you can start delivering from the next day itself. The onboarding process takes only two days.', 'faqs/696aa9ec4860070ffdd621ba5944c2d9.jpg', '2022-01-20 19:37:14', '2022-01-20 19:37:14', 11),
(68, 'Will any training be provided?', 'Our onboarding programme includes facilitator training on our ‘See it, Name it, Do it’ model and other key skills, an online platform induction and programme briefings covering everything Delivery Partners and facilitators need to know.', 'faqs/05a274f6ce863c342b691976d4a1deb6.jpg', '2022-01-20 19:42:56', '2022-01-20 19:42:56', 11),
(69, 'How do you manage meatxpresso delivery service?', 'Provide Great Service. Outsource Delivery Drivers. Proper Address and Client Communication. Focus On Packaging.', 'faqs/6ab2955d2cab93607c6328ef91314831.jpg', '2022-01-20 19:48:47', '2023-03-11 12:30:05', 12),
(70, 'Why is online delivery important?', 'Online meat ordering gives customers the freedom and choice to place an order at virtually any time, from anywhere, saving the time and resources typically spent on travelling to pick up a meat. It also gives the customers the advantage of reordering the favorite order in the easiest and hassle-free manner.', 'faqs/2d9cf8143ea802d38e917b9c75da0b6b.jpg', '2022-01-20 19:50:46', '2023-03-11 12:29:20', 3),
(71, 'What are some general guidelines for delivering meat safely?', 'Received meat should have the correct color, texture, and order. The packaging of delivered meat items must be intact and clean and it must protect food from contamination. There should also be no sings of pests or dampness. Meat items should be correctly labeled and contain the correct documentation.', 'faqs/7dd75fc4843e0f70e0ab318265c56667.jpg', '2022-01-20 19:53:43', '2023-03-11 12:28:29', 3),
(72, 'What is the issues of MeatXpresso delivery?', 'Revolved around late deliveries, incorrect orders being delivered, orders not being delivered at all, rude customer service, and the driver requiring a lot of guidance to find the delivery location', 'faqs/1d9ec22bda61ccbcdea2a115226ea083.jpg', '2022-01-20 20:55:21', '2023-03-11 12:31:05', 12),
(73, 'How does delivery app work?', 'Ordering occurs at the app where the menu of a partner shop is uploaded. Customers select the meat  items and make payments (some providers also offer cash on delivery). Once the amount goes through, the partner shop is notified about the request, and they can confirm or reject the order.', 'faqs/3754827e5777e9cf3f009389055fcb43.png', '2022-01-21 05:41:03', '2023-03-11 12:08:37', 12),
(74, 'How to order Meat', 'Select item from the list', 'faqs/f42df6cc9b8829e87b38d425ca650ce6.jpg', '2022-11-26 05:06:25', '2023-03-11 12:32:28', 15);
