INSERT INTO `privacy_policies` (`id`, `privacy_type`, `title`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 1, 'Information Collected', 'MeatXpresso Delivery, collects the information which is provided by you on registration, together with information we learn about you from your use of our service, your visits to our website, and your visits to other sites accessible from our web site. We also collect information about the transactions you undertake, including details of payment cards used.\r\n\r\nWe may collect additional information in connection with your participation in any promotional programs offered by MeatXpresso Delivery, and information you provide when giving us feedback or completing profile forms. We also monitor customer traffic patterns and site usage, which enables us to improve the products and services which MeatXpresso Delivery and its Members provide. In addition, MeatXpresso Delivery will access the information retrieved through your use of your MeatXpresso Delivery Club Card.\r\n\r\nIf you have objections to the Privacy Policy, you should immediately discontinue use of the Site and the Products and Services enabled by the Site.', 1, '2022-01-18 10:08:38', '2023-03-10 11:03:31'),
(2, 1, 'Legal Disclaimer', 'We reserve the right to disclose your personally identifiable information as required by law and when believe it is necessary to share information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of Foodlakh Delivery terms of use, or as otherwise required by law.', 1, '2022-01-18 10:12:11', '2022-11-26 05:37:36'),
(3, 2, 'Information Collected', 'We collects several types of information regarding our Guest User and Register Users: We collects personally identifiable information from our users. The personal information collected by us mainly consists of Contact Details (i.e. Email Address, Contact Number), Personal Details (i.e. User Name), Billing Details (i.e. Physical Billing address, Payment Method, Transaction Details), User Preferences (i.e. Preferences of order method, Time-zone, Language), User Comments (i.e. Feedback, Complain). We collect information so that you can place order, request information and support and make product suggestions.', 1, '2022-01-20 14:57:34', '2022-01-20 14:58:19'),
(4, 2, 'Legal Disclaimer', 'We reserve the right to disclose your personally identifiable information as required by law and when believe it is necessary to share information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of ToukTouk Delivery terms of use, or as otherwise required by law.', 1, '2022-01-20 15:01:25', '2022-01-20 15:01:25'),
(5, 3, 'Information Collected', 'We collects several types of information regarding our Guest User and Register Users: We collects personally identifiable information from our users. The personal information collected by us mainly consists of Contact Details (i.e. Email Address, Contact Number), Personal Details (i.e. User Name), Billing Details (i.e. Physical Billing address, Payment Method, Transaction Details), User Preferences (i.e. Preferences of order method, Time-zone, Language), User Comments (i.e. Feedback, Complain). We collect information so that you can place order, request information and support and make product suggestions.', 1, '2022-01-21 05:45:14', '2022-01-21 05:45:14'),
(6, 3, 'Legal Disclaimer', 'We reserve the right to disclose your personally identifiable information as required by law and when believe it is necessary to share information in order to investigate, prevent, or take action regarding illegal activities, suspected fraud, situations involving potential threats to the physical safety of any person, violations of ToukTouk Delivery terms of use, or as otherwise required by law.', 1, '2022-01-21 05:45:44', '2022-01-21 05:45:44');
