(1, 'Meat Xpresso Partner', 'images/fc7bfd631e94f07235603f3bd5743ce7.png', '₹', 'INR', 10, 'Meat Xpresso Partner App is the one-stop-solution for restaurants to manage their online orders from Food Galery Delivery and track their business growth as well. Download the app now and join our ever growing network of Happy Partners fulfilling online orders and becoming part of our mission to serve \"Better food for more people\".A restaurant app is a mobile application dedicated to a specific restaurant concept or chain of restaurants. Most restaurant apps are centered around digital ordering, but they typically also include information on guest loyalty rewards, specials, and promotions.', 'App version 1.0', 'Menpani Technology, Madurai, Tamilnadu', '2021-12-13 14:32:54', '2023-03-08 13:52:30');
